// DoctorSidebar.js

import React from "react";
import { Link, useLocation } from "react-router-dom";

const DoctorSidebar = () => {
  const location = useLocation();

  return (
    <div className="doctor-sidebar">
      <Link
        to="/doctor-dashboard"
        className={location.pathname === "/doctor-dashboard" ? "active" : ""}
      >
        Dashboard
      </Link>
      <Link
        to="/doctor-dashboard/inventory"
        className={
          location.pathname.startsWith("/doctor-dashboard/") ? "active" : ""
        }
      >
        Inventory
      </Link>
      <Link
        to="/doctor-dashboard/feedback-doctor"
        className={
          location.pathname === "/doctor-dashboard/feedback-doctor"
            ? "active"
            : ""
        }
      >
        Feedback
      </Link>
    </div>
  );
};

export default DoctorSidebar;
